        <div class="container">
            <div class="row">
                <div class="col-sm">Name</div>
                <div class="col">Type</div>
                <div class="w-100"></div>
                <div class="col"><Link to={`/pets/${pet._id}`}>Details</Link></div>
                <div class="col"> <Link to={`/pets/update/${pet._id}`}> <button className="btn btn-info mr-2">Edit</button></Link></div>
            </div>
        </div>


    )
}

export default Card;
